import http from "../http-common";

class TutorialDataService {
  getAll() {
    return http.get("/TEM");
  }

  get(id) {
    return http.get(`/TEM/${id}`);
  }

  create(data) {
    JSON.stringify(data);
    console.log(data);
    return http.post("/TEM", { email: "corviniemile@gmail.com" }, { headers: { 'Content-Type': 'application/json' }})
  }

  update(id, data) {
    return http.put(`/TEM/${id}`, data);
  }

  delete(id) {
    return http.delete(`/TEM/${id}`);
  }

  deleteAll() {
    return http.delete(`/TEM`);
  }

  findByTitle(title) {
    return http.get(`/TEM?title=${title}`);
  }
}

export default new TutorialDataService();
